import React from 'react';
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons';
import Nbar from '../NavxFooter/NavBar';
import PresentationWeb from './Pres';
import SecSectionP from './SecSectionP';
import Foo from '../NavxFooter/Footer';
import TsectionP from './TsectionP';

const PageF1 = () => {
  return (
    <div className='bg-white dark:bg-black'>
      <Parallax pages={4}>
        <ParallaxLayer speed={0} factor={1}>
          <Nbar/>
        </ParallaxLayer>
        <ParallaxLayer speed={0.5} factor={2}>
          <PresentationWeb/>
        </ParallaxLayer>
        <ParallaxLayer speed={0.8} factor={1}>
          <SecSectionP />
        </ParallaxLayer>
        <ParallaxLayer speed={1.2} factor={1}>
          <TsectionP /> 
        </ParallaxLayer>
      </Parallax>
      <Foo />
    </div>
  );
};

export default PageF1;
